import React from "react";

class Sum extends React.Component {
  render() {
    const { response, response2, response3 } = this.props;
    var sumEksterntLån = 0;
    var sumInterntSerieLån = 0;
    var sumInterntAnnuitetsLån = 0;
    if (response != null) {
      response.nedbetalingsplan.innbetalinger.map((row) => {
        sumEksterntLån += row.total;
      });
    }
    if (response != null) {
      response.nedbetalingsplan.innbetalinger.map((row) => {
        sumInterntSerieLån += row.total;
      });
    }
    if (response != null) {
      response.nedbetalingsplan.innbetalinger.map((row) => {
        sumInterntAnnuitetsLån += row.total;
      });
    }
    return (
      <div className="container">
        <div className="row">
          <div className="col">
            <h1>
              Total kostnad for eksternt lån: {Math.round(sumEksterntLån)}
            </h1>
          </div>
          <div className="col">
            <h1>
              Total kostnad for internt serielån:{" "}
              {Math.round(sumInterntSerieLån)}
            </h1>
          </div>
          <div className="col">
            <h1>
              Total kostnad for internt annuitetslån:{" "}
              {Math.round(sumInterntAnnuitetsLån)}
            </h1>
          </div>
        </div>
        <div className="row">
          <div className="col">
            <h1>{Math.round(sumEksterntLån)}</h1>
          </div>
          <div className="col">
            <h1>{Math.round(sumInterntSerieLån)}</h1>
          </div>
          <div className="col">
            <h1>{Math.round(sumInterntAnnuitetsLån)}</h1>
          </div>
        </div>
      </div>
    );
  }
}

export default Sum;
